void pca::linprog1()
{
    LinAlg::Matrix<double> Aeq = "1, 1, 1, 0"; LinAlg::Matrix<double> beq = "1";
    LinAlg::Matrix<double> A = "-15, 0, 0, -1; 0, -12, 0, -1; 0, 0, -12, -1;240, 0, 0, -1; 0, 27, 0, -1; 0, 0, 27, -1";
    LinAlg::Matrix<double> b = "-15;-12;-12;0;0;0";
    LinAlg::Matrix<double> obj = "0, 0, 0, 1";

    LinAlg::Matrix<double> result = OptimizationHandler::linprog<double>(obj,A,b,Aeq,beq);
    std::cout << result << std::endl;
    QVERIFY2(LinAlg::isEqual(result,LinAlg::Matrix<double>("0.058823529411765; 0.522875816993464; 0.418300653594771; 14.117647058823531"),1e-4),"Funcao Linprog de Programacao Linear com problemas");
}

