void pca::amandasControllerTest()
{

    LinAlg::Matrix<double> A = "0.4, 0.9; 0.6, 1.8";
    LinAlg::Matrix<double> B = "0;1";
    LinAlg::Matrix<double> G = ".2, .2 ;-1, -1 ;-1, .35 ;.25, -.5";
    LinAlg::Matrix<double> rho = LinAlg::Ones<double>(4,1);
    LinAlg::Matrix<double> D = "1;-1";
    LinAlg::Matrix<double> w = "1;1";
    LinAlg::Matrix<double> U = D;
    LinAlg::Matrix<double> phi = "10;10";
    //double lambda = 0.95;
    LinAlg::Matrix<double> E = LinAlg::Zeros<double>(2,1);

    LinAlg::Matrix<double> xr = ClusteringHandler::grid<double>(2,-2,5,0.1);

    uint32_t su, m, zero = 0;
    su = U.getNumberOfRows();
    m  = U.getNumberOfColumns();
    LinAlg::Matrix<double> fobj = (LinAlg::Zeros<double>(m,1)| LinAlg::Matrix<double>(1));

    LinAlg::Matrix<double> u(1,xr.getNumberOfColumns());
    double epsi;

    for (uint32_t i = 0; i < xr.getNumberOfColumns(); ++i)
    {
        LinAlg::Matrix<double> xk = xr(from(0)-->xr.getNumberOfRows()-1,i);  // Initial condition

//        std::cout << xk << "\n";

        LinAlg::Matrix<double> delta(G.getNumberOfRows(),xk.getNumberOfColumns());//[delta] = maxdistvect(E,Gf,D,w); %GfEd(k)

       LinAlg::Matrix<double> Aineq = ((G*B | -rho)  ||  (U | -LinAlg::Zeros<double>(su,1)));
       LinAlg::Matrix<double> bineq = ((-G*A*xk-delta)|| phi);
//       std::cout << Aineq << "\n";
//       std::cout << bineq << "\n";
//       std::cout << fobj << "\n";
       LinAlg::Matrix<double> Ue    = OptimizationHandler::linprog<double>(fobj, Aineq, bineq);

//       u = u|Ue(from(0)-->(m-1), zero);
       u(0,i) = Ue((m-1), zero);
       epsi = Ue(Ue.getNumberOfRows()-1,0);

    }

    //QMainWindow main;

   // PlotHandler::plot<double> controle(u,main.centralWidget());

    LinAlg::Matrix<double> dados = xr||u;

    std::cout <<= (dados);
    std::cout << "\n\n\n"<< std::endl << std::endl<< std::endl<< std::endl<< std::endl<< u;
    LinAlg::Matrix<PWAFunction<double> > PWA = ClusteringHandler::clustering(dados,0.15,0.12,2);
    std::cout << PWA(0,1).F;
}
